// react
import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconMenuSvg, IconArrowDown20Svg, IconClose20Svg, IconReset20Svg  } from '../../../content/images/svg';

// application

export default class QuickSearch extends Component {
    render() {
        return (
            <div className="quick-search">
                <div className="quick-search__nav-bar">
                    <div className="quick-search__action-button">
                        <IconMenuSvg className="quick-search__button-icon" />
                    </div>
                    <div className="quick-search__form search-combo">
                        <label className="search-combo__label">
                            Quick search
                        </label>
                        <div className="search-combo__input">
                            <input type="text" className="input-text input-md input-lg" />
                            <div className="search__button-group">
                                <button className="button-reset">
                                    <IconReset20Svg className="quick-search__button-icon" />
                                    <span>
                                        Reset
                                    </span>
                                </button>
                                <button className="button-drop">
                                    <IconArrowDown20Svg className="quick-search__button-icon" />
                                    <span>
                                        Drop
                                    </span>
                                </button>
                            </div>
                        </div>
                    </div>
                    <div className="quick-search__menu">

                    </div>
                </div>
            </div>
        );
    }
}
